import SwiftUI


struct FaviconServiceRequest {
    
    let session: Session
    let domain: String
    
}


extension FaviconServiceRequest: NCPasswordsRequest {
    
    var requiresSession: Bool {
        false
    }
    
    func send(completion: @escaping (UIImage?) -> Void) {
        let size = Int(64 * UIScreen.main.scale)
        if Configuration.isTestEnvironment {
            switch domain {
            case "cloud.example.com":
                completion(FaviconServiceRequest.mocks[0])
            case "github.com":
                completion(FaviconServiceRequest.mocks[1])
            case "en.wikipedia.org":
                completion(FaviconServiceRequest.mocks[2])
            default:
                break
            }
            return
        }
        get(action: "service/favicon/\(domain)/\(size)", session: session, completion: completion)
    }
    
    func decode(data: Data) -> UIImage? {
        guard let image = UIImage(data: data) else {
            LoggingController.shared.log(error: "Failed to decode favicon")
            return nil
        }
        return image
    }
    
}


extension FaviconServiceRequest: MockObject {
    
    static var mock: UIImage? {
        mocks.first!
    }
    
    static var mocks: [UIImage?] {
        [
            "",
            "",
            ""
        ].map { UIImage(data: Data(base64Encoded: $0)!) }
    }
    
}
